INSERT INTO iskyshop_document (`id` ,`addTime` ,`deleteStatus` ,`content` ,`mark` ,`title` ) VALUES ('1', '2014-04-28 15:19:54.0', '0', '<span></span><span>用户使用“ISkyShop B2B2C商城商家在线入驻系统”前请认真阅读并理解本协议内容，本协议内容中以加粗方式显著标识的条款，请用户着重阅读、慎重考虑。</span><br />\r\n<span><br />\r\n</span><br />\r\n<span>1.本协议的订立</span><br />\r\n<span><br />\r\n</span><br />\r\n<span>在本网站（www.iskyshop.com）依据《ISkyShop B2B2C商城网站用户注册协议》登记注册，且符合本网站商家入驻标准的用户（以下简称“商家”），在同意本协议全部条款后，方有资格使用“ISkyShop B2B2C商城商家在线入驻系统”（以下简称“入驻系统”） 申请入驻。一经商家点击“同意以上协议，下一步”按键，即意味着商家同意与本网站签订本协议并同意受本协议约束。</span><br />\r\n<span><br />\r\n</span><br />\r\n<span>2.入驻系统使用说明</span><br />\r\n<span><br />\r\n</span><br />\r\n<span>2.1 商家通过入驻系统提出入驻申请，并按照要求填写商家信息、提供商家资质资料后，由本网站审核并与有合作意向的商家联系协商合作相关事宜，经双方协商一致线下签订书面《开放平台供应商合作运营协议》（以下简称“运营协议”），且商家按照“运营协议”约定支付相应平台使用费及保证金等必要费用后，商家正式入驻本网站。本网站将为入驻商家开通商家后台系统（网址为:http://xxxx/<span>seller/login.htm</span>)，商家可通过商家后台系统在本网站运营自己的入驻店铺。</span><br />\r\n<span><br />\r\n</span><br />\r\n<span>2.2 商家以及本网站通过入驻系统做出的申请、资料提交及确认等各类沟通，仅为双方合作的意向以及本网站对商家资格审核的必备程序，除遵守本协议各项约定外，对双方不产生法律约束力。双方间最终合作事宜及运营规则均以“运营协议”的约定及商家后台系统公示的各项规则为准。</span><br />\r\n<span><br />\r\n</span><br />\r\n<span>3.商家权利义务</span><br />\r\n<span><br />\r\n</span><br />\r\n<span>3.1 商家应查看本网站公示的入驻商家标准，并确保资质符合本网站公示的基本要求，商家知悉并理解本网站将结合自身业务发展情况对商家进行选择。</span><br />\r\n<span><br />\r\n</span><br />\r\n<span>3.2 商家应按照本网站要求诚信提供入驻申请所需资料并如实填写相关信息，商家应确保提供的申请资料及信息真实、准确、完整、合法有效，经本网站审核通过后，商家不得擅自修改替换相应资料及主要信息。如商家提供的申请资料及信息不合法、不真实、不准确的，商家需承担因此引起的相应责任及后果，并且本网站有权立即终止商家使用入驻系统的权利。</span><br />\r\n<span><br />\r\n</span><br />\r\n<span>3.3 商家使用入驻系统提交的所有内容应不含有木马等软件病毒、政治宣传、或其他任何形式的“垃圾信息”、违法信息，且商家应按本网站规则使用入驻系统，不得从事影响或可能影响本网站或入驻系统正常运营的行为，否则，本网站有权清除前述内容，并有权立即终止商家使用入驻系统的权利。</span><br />\r\n<span><br />\r\n</span><br />\r\n<span>3.4 商家应注意查看入驻系统公示的入驻申请结果，如审核通过的商家，则按照本网站工作人员的通知按要求办理入驻的相关手续；如审批未通过的商家，则可自本网站通过入驻系统将审批结果告知商家（需商家登陆入驻系统查看）之日起 15 日内提出异议并提供相应资料，如审批仍未通过的，则商家同意提交的申请资料及信息本网站无需返还，由本网站自行处理。</span><br />\r\n<span><br />\r\n</span><br />\r\n<span>3.5 商家不得以任何形式擅自转让或授权他人使用自己在本网站的用户帐号使用入驻系统，否则由此产生的不利后果均由商家自行承担。</span><br />\r\n<span><br />\r\n</span><br />\r\n<span>4.本网站权利义务</span><br />\r\n<span><br />\r\n</span><br />\r\n<span>4.1 本网站开发的入驻系统仅为商家申请入驻的平台，商家正式入驻后，将在商家后台系统中运营本网站的入驻店铺。</span><br />\r\n<span><br />\r\n</span><br />\r\n<span>4.2 本网站有权对商家提供的资料及信息进行审核，并有权结合自身业务情况对合作商家进行选择；本网站对商家提交资料及信息的审核均不代表本网站对审核内容的真实、合法、准确、完整性作出的确认，商家应对提供资料及信息承担相应的法律责任。</span><br />\r\n<span><br />\r\n</span><br />\r\n<span>4.3 无论商家是否通过本网站的审核，本网站有权对商家提供的资料及信息予以留存并随时查阅，同时，本网站有义务对商家提供的资料予以保密，但国家行政机关、司法机关等国家机构调取资料的除外。</span><br />\r\n<span><br />\r\n</span><br />\r\n<span>4.4 本网站会尽力维护本系统信息的安全，但法律规定的不可抗力，以及因为黑客入侵、计算机病毒侵入发作等原因造成商家资料泄露、丢失、被盗用、被篡改的，本网站不承担任何责任。</span><br />\r\n<span><br />\r\n</span><br />\r\n<span>4.5 本网站应在现有技术支持的基础上确保入驻系统的正常运营，尽量避免入驻系统服务的中断给商家带来的不便。</span><br />\r\n<span><br />\r\n</span><br />\r\n<span>5.知识产权</span><br />\r\n<span><br />\r\n</span><br />\r\n<span>5.1 本网站开发的入驻系统及其包含的各类信息的知识产权归本网站所有者所有，受国家法律保护,本网站有权不时地对入驻系统的内容进行修改，并在入驻系统中公示，无须另行通知商家。</span><br />\r\n<span><br />\r\n</span><br />\r\n<span>5.2 在法律允许的最大限度范围内，本网站所有者对本协议及入驻系统涉及的内容拥有解释权。</span><br />\r\n<span><br />\r\n</span><br />\r\n<span>5.3 商家未经本网站所有者书面许可，不得擅自使用、非法全部或部分的复制、转载、抓取入驻系统中的信息，否则由此给本网站造成的损失，商家应予以全部赔偿。</span><br />\r\n<span><br />\r\n</span><br />\r\n<span>6.入驻系统服务的终止</span><br />\r\n<span><br />\r\n</span><br />\r\n<span>6.1 商家自行终止入驻申请，或商家经本网站审批未通过的，则入驻系统服务自行终止。</span><br />\r\n<span><br />\r\n</span><br />\r\n<span>6.2 商家使用本网站或入驻系统时，如违反相关法律法规或者违反本协议规定的，本网站有权随时终止商家使用入驻系统。</span><br />\r\n<span><br />\r\n</span><br />\r\n<span>7.本协议的修改</span><br />\r\n<span><br />\r\n</span><br />\r\n<span>本协议可由本网站随时修订，并将修订后的协议公告于本网站及入驻系统，修订后的条款内容自公告时起生效，并成为本协议的一部分。</span><br />\r\n<span><br />\r\n</span><br />\r\n<span>8.法律适用与争议解决</span><br />\r\n<span><br />\r\n</span><br />\r\n<span>8.1 本协议适用中华人民共和国法律。</span><br />\r\n<span><br />\r\n</span><br />\r\n<span>8.2 因本协议产生的任何争议，由双方协商解决，协商不成的，任何一方有权向有管辖权的中华人民共和国大陆地区法院提起诉讼。</span><br />\r\n<div>\r\n	<br />\r\n</div>\r\n<span></span>', 'apply_agreement', '入驻协议');
INSERT INTO iskyshop_document (`id` ,`addTime` ,`deleteStatus` ,`content` ,`mark` ,`title` ) VALUES ('2', '2014-04-28 15:23:48.0', '0', '<span>ISkyShop B2B2C 秉承“客户为先，诚信至上”的宗旨、 “让生活变得简单，快乐！”为我们的最终目标，为广大用户提供最优质的商品及服务。 ISkyShop B2B2C开放平台欢迎国际国内知名品牌、拥有特色货品及垂直电商入驻。</span><br />\r\n<span><br />\r\n</span><br />\r\n<span>一、以下规则，对于进驻ISkyShop B2B2C开放平台的商家至关重要,请务必仔细阅读：</span><br />\r\n<span><br />\r\n</span><br />\r\n<span>1、 ISkyShop B2B2C开放平台总则，详情请见 http://xxxxx</span><br />\r\n<span><br />\r\n</span><br />\r\n<span>2、 遵守ISkyShop B2B2C开放平台“行业标准”，所有发布的商品均符合行业发布规范。http://xxxxxx</span><br />\r\n<span><br />\r\n</span><br />\r\n<span>3、 遵守ISkyShop B2B2C开放平台卖家积分管理规则，详情请见 http://xxxxx</span><br />\r\n<span><br />\r\n</span><br />\r\n<span>4、 ISkyShop B2B2C开放平台店铺淘汰机制，详情请见http://xxxx</span><br />\r\n<span><br />\r\n</span><br />\r\n<span>二、为协助新商家顺利入驻，ISkyShop B2B2C开放平台为新入驻商家提供了丰富的基础培训教程：</span><br />\r\n<span><br />\r\n</span><br />\r\n<span>1、关于新商家入驻后的必修课程，请进入“ISkyShop B2B2C卖家培训”模板查看http://xxxxxx</span><br />\r\n<span><br />\r\n</span><br />\r\n<span>2、运营分析数据，请进入查看http://xxxxx</span><br />\r\n<span><br />\r\n</span><br />\r\n<span>三、了解其他运营规则及信息：</span><br />\r\n<span><br />\r\n</span><br />\r\n<span>请及时关注商家中心公告信息。</span><br />\r\n<span></span>', 'apply_notice', '入驻须知');
INSERT INTO iskyshop_document (`id` ,`addTime` ,`deleteStatus` ,`content` ,`mark` ,`title` ) VALUES ('3', '2014-05-04 11:50:55.0', '0', '<span>ISkyShop B2B2C用户注册协议</span><br />\r\n<span><br />\r\n</span><span>本协议是您与ISkyShop B2B2C网站（简称"本站"，网址：www.iskyshop.com）所有者（以下简称为"ISkyShop B2B2C"）之间就ISkyShop B2B2C网站服务等相关事宜所订立的契约，请您仔细阅读本注册协议，您点击"同意并继续"按钮后，本协议即构成对双方有约束力的法律文件。</span><br />\r\n<span>第1条 本站服务条款的确认和接纳</span><br />\r\n<span><br />\r\n</span><br />\r\n<span>1.1本站的各项电子服务的所有权和运作权归ISkyShop B2B2C所有。用户同意所有注册协议条款并完成注册程序，才能成为本站的正式用户。用户确认：本协议条款是处理双方权利义务的契约，始终有效，法律另有强制性规定或双方另有特别约定的，依其规定。</span><br />\r\n<span><br />\r\n</span><br />\r\n<span>1.2用户点击同意本协议的，即视为用户确认自己具有享受本站服务、下单购物等相应的权利能力和行为能力，能够独立承担法律责任。</span><br />\r\n<span><br />\r\n</span><br />\r\n<span>1.3如果您在18周岁以下，您只能在父母或监护人的监护参与下才能使用本站。</span><br />\r\n<span><br />\r\n</span><br />\r\n<span>1.4ISkyShop B2B2C保留在中华人民共和国大陆地区法施行之法律允许的范围内独自决定拒绝服务、关闭用户账户、清除或编辑内容或取消订单的权利。</span><br />\r\n<span>第2条 本站服务</span><br />\r\n<span><br />\r\n</span><br />\r\n<span>2.1ISkyShop B2B2C通过互联网依法为用户提供互联网信息等服务，用户在完全同意本协议及本站规定的情况下，方有权使用本站的相关服务。</span><br />\r\n<span><br />\r\n</span><br />\r\n<span>2.2用户必须自行准备如下设备和承担如下开支：（1）上网设备，包括并不限于电脑或者其他上网终端、调制解调器及其他必备的上网装置；（2）上网开支，包括并不限于网络接入费、上网设备租用费、手机流量费等。</span><br />\r\n<span>第3条 用户信息</span><br />\r\n<span><br />\r\n</span><br />\r\n<span>3.1用户应自行诚信向本站提供注册资料，用户同意其提供的注册资料真实、准确、完整、合法有效，用户注册资料如有变动的，应及时更新其注册资料。如果用户提供的注册资料不合法、不真实、不准确、不详尽的，用户需承担因此引起的相应责任及后果，并且ISkyShop B2B2C保留终止用户使用ISkyShop B2B2C各项服务的权利。</span><br />\r\n<span><br />\r\n</span><br />\r\n<span>3.2用户在本站进行浏览、下单购物等活动时，涉及用户真实姓名/名称、通信地址、联系电话、电子邮箱等隐私信息的，本站将予以严格保密，除非得到用户的授权或法律另有规定，本站不会向外界披露用户隐私信息。</span><br />\r\n<span><br />\r\n</span><br />\r\n<span>3.3用户注册成功后，将产生用户名和密码等账户信息，您可以根据本站规定改变您的密码。用户应谨慎合理的保存、使用其用户名和密码。用户若发现任何非法使用用户账号或存在安全漏洞的情况，请立即通知本站并向公安机关报案。</span><br />\r\n<span><br />\r\n</span><br />\r\n<span>3.4用户同意，ISkyShop B2B2C拥有通过邮件、短信电话等形式，向在本站注册、购物用户、收货人发送订单信息、促销活动等告知信息的权利。</span><br />\r\n<span><br />\r\n</span><br />\r\n<span>3.5用户不得将在本站注册获得的账户借给他人使用，否则用户应承担由此产生的全部责任，并与实际使用人承担连带责任。</span><br />\r\n<span><br />\r\n</span><br />\r\n<span>3.6用户同意，ISkyShop B2B2C有权使用用户的注册信息、用户名、密码等信息，登陆进入用户的注册账户，进行证据保全，包括但不限于公证、见证等。</span><br />\r\n<span>第4条 用户依法言行义务</span><br />\r\n<span><br />\r\n</span><br />\r\n<span>本协议依据国家相关法律法规规章制定，用户同意严格遵守以下义务：</span><br />\r\n<span><br />\r\n</span><br />\r\n<span>（1）不得传输或发表：煽动抗拒、破坏宪法和法律、行政法规实施的言论，煽动颠覆国家政权，推翻社会主义制度的言论，煽动分裂国家、破坏国家统一的的言论，煽动民族仇恨、民族歧视、破坏民族团结的言论；</span><br />\r\n<span><br />\r\n</span><br />\r\n<span>（2）从中国大陆向境外传输资料信息时必须符合中国有关法规；</span><br />\r\n<span><br />\r\n</span><br />\r\n<span>（3）不得利用本站从事洗钱、窃取商业秘密、窃取个人信息等违法犯罪活动；</span><br />\r\n<span><br />\r\n</span><br />\r\n<span>（4）不得干扰本站的正常运转，不得侵入本站及国家计算机信息系统；</span><br />\r\n<span><br />\r\n</span><br />\r\n<span>（5）不得传输或发表任何违法犯罪的、骚扰性的、中伤他人的、辱骂性的、恐吓性的、伤害性的、庸俗的，淫秽的、不文明的等信息资料；</span><br />\r\n<span><br />\r\n</span><br />\r\n<span>（6）不得传输或发表损害国家社会公共利益和涉及国家安全的信息资料或言论；</span><br />\r\n<span><br />\r\n</span><br />\r\n<span>（7）不得教唆他人从事本条所禁止的行为；</span><br />\r\n<span><br />\r\n</span><br />\r\n<span>（8）不得利用在本站注册的账户进行牟利性经营活动；</span><br />\r\n<span><br />\r\n</span><br />\r\n<span>（9）不得发布任何侵犯他人著作权、商标权等知识产权或合法权利的内容；</span><br />\r\n<span><br />\r\n</span><br />\r\n<span>用户应不时关注并遵守本站不时公布或修改的各类合法规则规定。</span><br />\r\n<span><br />\r\n</span><br />\r\n<span>本站保有删除站内各类不符合法律政策或不真实的信息内容而无须通知用户的权利。</span><br />\r\n<span><br />\r\n</span><br />\r\n<span>若用户未遵守以上规定的，本站有权作出独立判断并采取暂停或关闭用户帐号等措施。用户须对自己在网上的言论和行为承担法律责任。</span><br />\r\n<span>第5条 商品信息</span><br />\r\n<span><br />\r\n</span><br />\r\n<span>本站上的商品价格、数量、是否有货等商品信息随时都有可能发生变动，本站不作特别通知。由于网站上商品信息的数量极其庞大，虽然本站会尽最大努力保证您所浏览商品信息的准确性，但由于众所周知的互联网技术因素等客观原因存在，本站网页显示的信息可能会有一定的滞后性或差错，对此情形您知悉并理解；ISkyShop B2B2C欢迎纠错，并会视情况给予纠错者一定的奖励。</span><br />\r\n<span><br />\r\n</span><br />\r\n<span>为表述便利，商品和服务简称为"商品"或"货物"。</span><br />\r\n<span>第6条 订单</span><br />\r\n<span><br />\r\n</span><br />\r\n<span>6.1在您下订单时，请您仔细确认所购商品的名称、价格、数量、型号、规格、尺寸、联系地址、电话、收货人等信息。收货人与用户本人不一致的，收货人的行为和意思表示视为用户的行为和意思表示，用户应对收货人的行为及意思表示的法律后果承担连带责任。</span><br />\r\n<span><br />\r\n</span><br />\r\n<span>6.2除法律另有强制性规定外，双方约定如下：本站上销售方展示的商品和价格等信息仅仅是要约邀请，您下单时须填写您希望购买的商品数量、价款及支付方式、收货人、联系方式、收货地址（合同履行地点）、合同履行方式等内容；系统生成的订单信息是计算机信息系统根据您填写的内容自动生成的数据，仅是您向销售方发出的合同要约；销售方收到您的订单信息后，只有在销售方将您在订单中订购的商品从仓库实际直接向您发出时（ 以商品出库为标志），方视为您与销售方之间就实际直接向您发出的商品建立了合同关系；如果您在一份订单里订购了多种商品并且销售方只给您发出了部分商品时，您与销售方之间仅就实际直接向您发出的商品建立了合同关系；只有在销售方实际直接向您发出了订单中订购的其他商品时，您和销售方之间就订单中该其他已实际直接向您发出的商品才成立合同关系。您可以随时登陆您在本站注册的账户，查询您的订单状态。</span><br />\r\n<span><br />\r\n</span><br />\r\n<span>6.3由于市场变化及各种以合理商业努力难以控制的因素的影响，本站无法保证您提交的订单信息中希望购买的商品都会有货；如您拟购买的商品，发生缺货，您有权取消订单。</span><br />\r\n<span>第7条 配送</span><br />\r\n<span><br />\r\n</span><br />\r\n<span>7.1销售方将会把商品（货物）送到您所指定的收货地址，所有在本站上列出的送货时间为参考时间，参考时间的计算是根据库存状况、正常的处理过程和送货时间、送货地点的基础上估计得出的。</span><br />\r\n<span><br />\r\n</span><br />\r\n<span>7.2因如下情况造成订单延迟或无法配送等，销售方不承担延迟配送的责任：</span><br />\r\n<span><br />\r\n</span><br />\r\n<span>（1）用户提供的信息错误、地址不详细等原因导致的；</span><br />\r\n<span><br />\r\n</span><br />\r\n<span>（2）货物送达后无人签收，导致无法配送或延迟配送的；</span><br />\r\n<span><br />\r\n</span><br />\r\n<span>（3）情势变更因素导致的；</span><br />\r\n<span><br />\r\n</span><br />\r\n<span>（4）不可抗力因素导致的，例如：自然灾害、交通戒严、突发战争等。</span><br />\r\n<span>第8条 所有权及知识产权条款</span><br />\r\n<span><br />\r\n</span><br />\r\n<span>8.1用户一旦接受本协议，即表明该用户主动将其在任何时间段在本站发表的任何形式的信息内容（包括但不限于客户评价、客户咨询、各类话题文章等信息内容）的财产性权利等任何可转让的权利，如著作权财产权（包括并不限于：复制权、发行权、出租权、展览权、表演权、放映权、广播权、信息网络传播权、摄制权、改编权、翻译权、汇编权以及应当由著作权人享有的其他可转让权利），全部独家且不可撤销地转让给ISkyShop B2B2C所有，用户同意ISkyShop B2B2C有权就任何主体侵权而单独提起诉讼。</span><br />\r\n<span><br />\r\n</span><br />\r\n<span>8.2本协议已经构成《中华人民共和国著作权法》第二十五条（条文序号依照2011年版著作权法确定）及相关法律规定的著作财产权等权利转让书面协议，其效力及于用户在ISkyShop B2B2C网站上发布的任何受著作权法保护的作品内容，无论该等内容形成于本协议订立前还是本协议订立后。</span><br />\r\n<span><br />\r\n</span><br />\r\n<span>8.3用户同意并已充分了解本协议的条款，承诺不将已发表于本站的信息，以任何形式发布或授权其它主体以任何方式使用（包括但限于在各类网站、媒体上使用）。</span><br />\r\n<span><br />\r\n</span><br />\r\n<span>8.4ISkyShop B2B2C是本站的制作者,拥有此网站内容及资源的著作权等合法权利,受国家法律保护,有权不时地对本协议及本站的内容进行修改，并在本站张贴，无须另行通知用户。在法律允许的最大限度范围内，ISkyShop B2B2C对本协议及本站内容拥有解释权。</span><br />\r\n<span><br />\r\n</span><br />\r\n<span>8.5除法律另有强制性规定外，未经ISkyShop B2B2C明确的特别书面许可,任何单位或个人不得以任何方式非法地全部或部分复制、转载、引用、链接、抓取或以其他方式使用本站的信息内容，否则，ISkyShop B2B2C有权追究其法律责任。</span><br />\r\n<span><br />\r\n</span><br />\r\n<span>8.6本站所刊登的资料信息（诸如文字、图表、标识、按钮图标、图像、声音文件片段、数字下载、数据编辑和软件），均是ISkyShop B2B2C或其内容提供者的财产，受中国和国际版权法的保护。本站上所有内容的汇编是ISkyShop B2B2C的排他财产，受中国和国际版权法的保护。本站上所有软件都是ISkyShop B2B2C或其关联公司或其软件供应商的财产，受中国和国际版权法的保护。</span><br />\r\n<span>第9条 责任限制及不承诺担保</span><br />\r\n<span><br />\r\n</span><br />\r\n<span>除非另有明确的书面说明,本站及其所包含的或以其它方式通过本站提供给您的全部信息、内容、材料、产品（包括软件）和服务，均是在"按现状"和"按现有"的基础上提供的。</span><br />\r\n<span><br />\r\n</span><br />\r\n<span>除非另有明确的书面说明,ISkyShop B2B2C不对本站的运营及其包含在本网站上的信息、内容、材料、产品（包括软件）或服务作任何形式的、明示或默示的声明或担保（根据中华人民共和国法律另有规定的以外）。</span><br />\r\n<span><br />\r\n</span><br />\r\n<span>ISkyShop B2B2C不担保本站所包含的或以其它方式通过本站提供给您的全部信息、内容、材料、产品（包括软件）和服务、其服务器或从本站发出的电子信件、信息没有病毒或其他有害成分。</span><br />\r\n<span><br />\r\n</span><br />\r\n<span>如因不可抗力或其它本站无法控制的原因使本站销售系统崩溃或无法正常使用导致网上交易无法完成或丢失有关的信息、记录等，ISkyShop B2B2C会合理地尽力协助处理善后事宜。</span><br />\r\n<span>第10条 协议更新及用户关注义务</span><br />\r\n<span>根据国家法律法规变化及网站运营需要，ISkyShop B2B2C有权对本协议条款不时地进行修改，修改后的协议一旦被张贴在本站上即生效，并代替原来的协议。用户可随时登陆查阅最新协议；用户有义务不时关注并阅读最新版的协议及网站公告。如用户不同意更新后的协议，可以且应立即停止接受ISkyShop B2B2C网站依据本协议提供的服务；如用户继续使用本网站提供的服务的，即视为同意更新后的协议。ISkyShop B2B2C建议您在使用本站之前阅读本协议及本站的公告。 如果本协议中任何一条被视为废止、无效或因任何理由不可执行，该条应视为可分的且并不影响任何其余条款的有效性和可执行性。</span><br />\r\n<span>第11条 法律管辖和适用</span><br />\r\n<span>本协议的订立、执行和解释及争议的解决均应适用在中华人民共和国大陆地区适用之有效法律（但不包括其冲突法规则）。 如发生本协议与适用之法律相抵触时，则这些条款将完全按法律规定重新解释，而其它有效条款继续有效。 如缔约方就本协议内容或其执行发生任何争议，双方应尽力友好协商解决；协商不成时，任何一方均可向有管辖权的中华人民共和国大陆地区法院提起诉讼。</span><br />\r\n<span>第12条 其他</span><br />\r\n<span><br />\r\n</span><br />\r\n<span>12.1ISkyShop B2B2C网站所有者是指在政府部门依法许可或备案的ISkyShop B2B2C网站经营主体。</span><br />\r\n<span><br />\r\n</span><br />\r\n<span>12.2ISkyShop B2B2C尊重用户和消费者的合法权利，本协议及本网站上发布的各类规则、声明等其他内容，均是为了更好的、更加便利的为用户和消费者提供服务。本站欢迎用户和社会各界提出意见和建议，ISkyShop B2B2C将虚心接受并适时修改本协议及本站上的各类规则。</span><br />\r\n<span><br />\r\n</span><br />\r\n<span>12.3本协议内容中以黑体、加粗、下划线、斜体等方式显著标识的条款，请用户着重阅读。</span><br />\r\n<span><br />\r\n</span><br />\r\n<span>12.4您点击本协议下方的"同意并继续"按钮即视为您完全接受本协议，在点击之前请您再次确认已知悉并完全理解本协议的全部内容。</span><br />', 'reg_agree', '注册协议');
INSERT INTO iskyshop_document (`id` ,`addTime` ,`deleteStatus` ,`content` ,`mark` ,`title` ) VALUES ('4', '2014-05-06 14:33:37.0', '0', '<h3 style="text-align:center;">\r\n	<span style="color:#666666;"><br />\r\n</span>\r\n</h3>\r\n<h3 style="text-align:center;">\r\n	<span style="color:#666666;">商家入驻类目费用标准</span>\r\n</h3>\r\n<p style="text-align:center;">\r\n	<span>\r\n	<table style="width:100%;" cellpadding="2" cellspacing="0" border="1" bordercolor="#666666">\r\n		<tbody>\r\n			<tr>\r\n				<td style="text-align:center;">\r\n					<span style="color:#666666;">一级类目</span><span style="color:#666666;">&nbsp; &nbsp;</span>\r\n				</td>\r\n				<td style="text-align:center;">\r\n					<span style="color:#666666;">二级类目</span><br />\r\n				</td>\r\n				<td style="text-align:center;">\r\n					<span style="color:#666666;">佣金标准</span>\r\n				</td>\r\n			</tr>\r\n			<tr>\r\n				<td>\r\n					<br />\r\n				</td>\r\n				<td>\r\n					<br />\r\n				</td>\r\n				<td>\r\n					<br />\r\n				</td>\r\n			</tr>\r\n			<tr>\r\n				<td style="text-align:center;">\r\n					<br />\r\n				</td>\r\n				<td style="text-align:center;">\r\n					<br />\r\n				</td>\r\n				<td style="text-align:center;">\r\n					<br />\r\n				</td>\r\n			</tr>\r\n			<tr>\r\n				<td style="text-align:center;">\r\n					<br />\r\n				</td>\r\n				<td style="text-align:center;">\r\n					<br />\r\n				</td>\r\n				<td style="text-align:center;">\r\n					<br />\r\n				</td>\r\n			</tr>\r\n		</tbody>\r\n	</table>\r\n<br />\r\n<br />\r\n</span>\r\n</p>', 'goodsClassFee', '商家入驻类目费用标准');
INSERT INTO iskyshop_document (`id` ,`addTime` ,`deleteStatus` ,`content` ,`mark` ,`title` ) VALUES ('5', '2014-06-13 12:04:08.0', '0', '<h3 style="font-size:18px;font-family:''Microsoft YaHei'', SimHei;font-weight:normal;color:#469020;font-style:normal;text-indent:0px;">\r\n	保障范围说明\r\n</h3>\r\n<p style="color:#404040;text-indent:0px;">\r\n	以下类目商品（商城将不时公示新增或减少支持该服务的类目商品）支持“退货承诺”服务。\r\n</p>\r\n<p style="color:#404040;text-indent:0px;">\r\n	女鞋、美容护肤/美体/精油、运动鞋new、男装、彩妆/香水/美妆工具、美发护发/假发、流行男鞋、运动/瑜伽/健身/球迷用品、户外/登山/野营/旅行用品、女装/女士精品、运动包/户外包/配件、运动服/休闲服装等\r\n</p>\r\n<h3 style="font-size:18px;font-family:''Microsoft YaHei'', SimHei;font-weight:normal;color:#469020;font-style:normal;text-indent:0px;">\r\n	保障期限\r\n</h3>\r\n<p style="color:#404040;text-indent:0px;">\r\n	自买家签收货物起至卖家承诺保障时间内\r\n</p>\r\n<h3 style="font-size:18px;font-family:''Microsoft YaHei'', SimHei;font-weight:normal;color:#469020;font-style:normal;text-indent:0px;">\r\n	买家可享受的保障权益\r\n</h3>\r\n<p style="color:#404040;text-indent:0px;">\r\n	买家在购买了支持退货承诺服务的商品，即可享受卖家提供的退货服务。即买家退货时符合约定的商品状态和退货时间，买家可以无理由向卖家提出退货要求，卖家应无条件同意。\r\n</p>\r\n<h3 style="font-size:18px;font-family:''Microsoft YaHei'', SimHei;font-weight:normal;color:#469020;font-style:normal;text-indent:0px;">\r\n	相关费用\r\n</h3>\r\n<p>\r\n	买家责任(不喜欢/不合适等)，运费依照交易约定内容执行\r\n</p>\r\n<p>\r\n	商城判定卖家责任（如商品存在质量问题，描述不符和等），来回运费都需要卖家承担\r\n</p>\r\n<p>\r\n	约定不清的情形，可申请商城客服介入处理,客服会依据事实进行判定。\r\n</p>\r\n<p>\r\n	提出消费者保障赔付的条件\r\n</p>\r\n<p>\r\n	买家提出退货申请所指向的商品支持“退货承诺”服务；\r\n</p>\r\n<p>\r\n	买家的退货申请在形式上符合相关法律法规的规定；\r\n</p>\r\n<p>\r\n	商品保持约定中要求的商品状态，如卖家同意合约协议后，则买家需在卖家确认同意的承诺时间内寄回商品，如逾期未填写退货单号将退款关闭/售后维权撤消，视为放弃此项服务后续不再进行此项合约服务；\r\n</p>\r\n<p>\r\n	退款申请金额仅以买家实际支付的商品价款为限。\r\n</p>\r\n<p>\r\n	外包装完整，且不影响二次销售，退款时如有发票或赠品，买家需将发票和赠品一起退回。\r\n</p>', 'service', '售后服务');
