INSERT INTO iskyshop_document (`id` ,`addTime` ,`deleteStatus` ,`content` ,`mark` ,`title` ) VALUES ('7', '2014-06-13 13:16:10.0', '0', '<h3 style="font-size:18px;font-family:''Microsoft YaHei'', SimHei;font-weight:normal;color:#469020;font-style:normal;text-indent:0px;">\r\n	保障范围说明\r\n</h3>\r\n<p style="color:#404040;text-indent:0px;">\r\n	以下类目商品（商城将不时公示新增或减少支持该服务的类目商品）支持“指定快递”服务:\r\n</p>\r\n<ol style="color:#404040;text-indent:0px;">\r\n	<li>\r\n		水产肉类/新鲜蔬果/熟食&gt;&gt;海鲜/水产品/制品；\r\n	</li>\r\n	<li>\r\n		水产肉类/新鲜蔬果/熟食&gt;&gt;新鲜水果/水果制品；\r\n	</li>\r\n	<li>\r\n		零食/坚果/特产&gt;&gt;山核桃/坚果/炒货；\r\n	</li>\r\n</ol>\r\n<h3 style="font-size:18px;font-family:''Microsoft YaHei'', SimHei;font-weight:normal;color:#469020;font-style:normal;text-indent:0px;">\r\n	保障期限\r\n</h3>\r\n<ol style="color:#404040;text-indent:0px;">\r\n	<li>\r\n		自订单关闭状态之日起15天内\r\n	</li>\r\n	<li>\r\n		如针对卖家未履行服务承诺行为，买家向商城发起投诉的期限为自订单关闭状态之日起15天内。\r\n	</li>\r\n</ol>\r\n<h3 style="font-size:18px;font-family:''Microsoft YaHei'', SimHei;font-weight:normal;color:#469020;font-style:normal;text-indent:0px;">\r\n	买家可享受的保障权益\r\n</h3>\r\n<ol style="color:#404040;text-indent:0px;">\r\n	<li>\r\n		买家付款订单支持指定快递服务，则买家可享受到自主选择快递配送订单的服务；\r\n	</li>\r\n	<li>\r\n		自订单关闭状态之日起15天内，如买家发现配送快递公司不符，且与卖家协商未果，买家有权在商城指定期限内发起维权，经判定维权成立的，卖家保证金先行赔付，以保障买家利益；\r\n	</li>\r\n	<li>\r\n		赔偿金额以订单实际支付运费价款为限，赔付金额最低不少于5元，最高不超过30元。\r\n	</li>\r\n</ol>\r\n<h3 style="font-size:18px;font-family:''Microsoft YaHei'', SimHei;font-weight:normal;color:#469020;font-style:normal;text-indent:0px;">\r\n	提出消费者保障赔付的条件\r\n</h3>\r\n<ol style="color:#404040;text-indent:0px;">\r\n	<li>\r\n		买家提出赔付申请所指向的订单支持“指定快递”服务；\r\n	</li>\r\n	<li>\r\n		买家的赔付申请在形式上符合相关法律法规的规定；\r\n	</li>\r\n	<li>\r\n		家申请赔付金额以订单实际支付运费价款为限，赔付金额最低不少于5元，最高不超过30元；\r\n	</li>\r\n	<li>\r\n		申请金额仅以买家实际支付的商品价款为限；\r\n	</li>\r\n	<li>\r\n		买家提出“指定快递”赔付申请应在交易关闭状态之日起15天内，发起以“承诺的没做到-物流”原因的投诉。\r\n	</li>\r\n</ol>', 'complaint', '投诉中心');
