INSERT INTO iskyshop_document (`id` ,`addTime` ,`deleteStatus` ,`content` ,`mark` ,`title` ) VALUES ('9', '2014-06-13 13:36:04.0', '0', '<p>\r\n	会员兑换积分礼品时，会员的等级需要高于或等于该积分礼品限制的会员等级，如果低于，则不具备兑换资格。\r\n</p>\r\n<p>\r\n	某些积分礼品会存在一个兑换时间，如果当前的时间不在该礼品的兑换时间之内，则不能兑换该礼品。\r\n</p>\r\n<p>\r\n	大部分积分礼品的数量有限，预换从速。\r\n</p>\r\n<p>\r\n	如果会员的会员等级满足礼品限制的兑换会员等级，但是会员的积分不足，也会导致礼品兑换失败。\r\n</p>', 'integral', '积分兑换说明');
