INSERT INTO iskyshop_template (`id` ,`addTime` ,`deleteStatus` ,`content` ,`info` ,`mark` ,`open` ,`title` ,`type` ) VALUES ('229384', '2012-09-03 10:32:50.0', '0', '${#user.userName},您好，您的店铺因违规被关闭！原因是:${#reason}<br />', '[给卖家]店铺被管理员关闭时的通知', 'msg_toseller_store_closed_notify', 1, '店铺违规关闭', 'msg');
